import styles from "./BonbonSummary.module.css";

const BonbonSummary = () => {
  return (
    <section className={styles.summary}>
      <h2>Wyjatkowe słodkosci na szczegolne momenty</h2>
      <p>Pracownia cukiernicza tworzaca wyjatkowe mono-desery.</p>
      <p>
        Każdy product wykonujemy ze szczególna uwaga oraz przy użyciu najwyższej
        jakości swieżych, naturalnych składników.
      </p>
    </section>
  );
};
export default BonbonSummary;
